import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

function Header() {
    return (
      <header className="main_header">
        <div className="container">
        <div className="row">
          <div className="col-md-6"><FontAwesomeIcon icon={['fas', 'check']} />tghth</div>
        </div>
        </div>
      </header>
    );
  }
  
  export default Header;
